import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router,Switch, Navigate, Route, Routes } from "react-router-dom";

import NavbarPropio from "./layouts/navbar";
import Cart from "./components/cart";
import Search from './components/search';

function App() {
  return (
    <div className="App">
      <Router>
      <NavbarPropio/>
      <Switch>
        <Route path='/cart' component ={Cart}/>
        <Route path='/search' component ={Search}/>
        <Route path='*' element ={< Navigate replace to ="/" />}/>
      </Switch>
      </Router>
    </div>
  );
}

export default App;
